import React from "react";

const Chart = ({ data }) => {
  return (
    <div className="w-100 h-100">
      {data.map((x) => {
        return <div className={`h-20 w-${x * 20} bg-primary my-2`}></div>;
      })}
    </div>
  );
};

export default Chart;
